import React from "react";

function Header() {
    return (
        <>
            <p>This is the header of the screen!</p>

            <nav>
                <ul>
                    <li>
                        <Link to = '/movies'>see all the movies</Link>
                    </li>
                </ul>
            </nav>
        </>
    )
}

export default Header;
